import React from 'react';
import './Header.css';

function Header() {
    return (
        <div className='Header'>
            <div className='Navbar'>
                <div className='Navbutton'>
                    Home
                </div>
                <div className='Navbutton'>
                    Transactions
                </div>
                <div className='Navbutton'>
                    Summary
                </div>
            </div>
        </div>
    )
}

export default Header;
